import React, {useState} from 'react'

function UseStateWithArrays() {
    const [nums, setNums] = useState([1,2,3]);
    return (
        <div>
            <ul>
                {nums.map(num => <li key="num" >num</li>) }
            </ul>
        </div>
    )
}

export default UseStateWithArrays
